import React from 'react';

const SignIn = () => {
    return (
        <>
            <div className="main-container">
                <div className="logo-container">
                    <img className="logo-image" src="/images/logo.png" />
                    <img className="logo-name" src="/images/GiftÜ.png" />
                </div>
                <p className="title">SIGN IN</p>
                <div className="input-container">
                    <span className="label">
                        Email
                        <img className="input-image" src="/images/key.png" />
                    </span>
                    <input type="text" className="input"/>
                </div>
                <div className="input-container">
                    <span className="label">
                        Password
                        <img className="input-image" src="/images/mail.png" />
                    </span>
                    <input type="text" className="input"/>
                </div>
            </div>
            <style jsx> {`
                    .main-container {
                        width: 100%;
                        height: 100vh;
                        display: flex;
                        flex-direction: column;
                        align-items: center;
                        justify-content: center;
                    }
                    .logo-container {
                        display: flex;
                        flex-direction: column;
                        align-items: center;
                    }
                    .logo-image {
                        height: 100px;
                        width: auto;
                    }
                    .logo-name {
                        height: auto;
                        width: 100px;
                    }
                    .title {
                        line-height: 30px;
                        letter-spacing: 0.14em;
                        font-weight: bold;
                        font-size: 24px;
                        font-family: 'Quicksand', sans-serif;
                        margin: 30px 0;
                    }
                    .label {
                        font-family: 'Quicksand', sans-serif;
                        font-size: 14px;
                        line-height: 17px;
                        letter-spacing: 0.14em;
                        font-feature-settings: 'case'
                    }
                    .input-container {
                        display: flex;
                        flex-direction: column;
                        justify-content: space-around;
                        height: 100px;
                    }
                    .input {
                        width: 258px;
                        background: transparent;
                        border: none;
                        border-bottom: 2px solid rgba(135, 211, 184, 0.6);
                        font-family: 'Quicksand', sans-serif;
                        font-size: 14px;
                        line-height: 17px;
                        color: #FFAB07;
                        padding: 10px 0;
                    }
                    .input:focus, textarea:focus, select:focus{
                        outline: none;
                    }
                    .input-image:first-type-of {
                        width: 18px;
                        height: 12.75px;
                    }
                    .input-image {
                        width: 16px;
                        height: 16px;
                    }
                `}
            </style>
        </>

    );
};

export default SignIn;
